import React, { useState, useEffect } from 'react';

const Counter = () => {
    const [count, setCount] = useState(0);

    useEffect(() => {
        document.title = `${count} click(s)`;
    });

    const upCount = () => {
        setCount(count + 1);
    }

    const downCount = () => {
        setCount(count - 1);
    }

